import React from "react";
import Productivity from "./Productivity";

const Dashboard = () => {
  return (
    <div className="p-6">
      <h2 className="text-3xl font-bold mb-4">Student Productivity Dashboard</h2>
      <Productivity />
    </div>
  );
};

export default Dashboard;
